    override fun execute(context: ResourceContext) {
        this.context = context
    }

    override fun close() {
        // app icon for system
        val attrToRemove = "android:drawable"
        val factory: DocumentBuilderFactory = DocumentBuilderFactory.newInstance()
        val builder: DocumentBuilder = factory.newDocumentBuilder()

        val bgElement = builder.parse(ByteArrayInputStream(ic_bg.toByteArray())).documentElement
        val fgElement = builder.parse(ByteArrayInputStream(ic_normal_fg.toByteArray())).documentElement
        val roundFgElement = builder.parse(ByteArrayInputStream(ic_round_fg.toByteArray())).documentElement

        for (i in 0 until 2)
        context.xmlEditor[if (i == 0) "res/mipmap-anydpi/ic_launcher_twitter.xml" else "res/mipmap-anydpi/ic_launcher_twitter_round.xml"].use { editor ->
            val root = editor.file.getElementsByTagName("adaptive-icon").item(0) as Element
            val m = editor.file.getElementsByTagName("monochrome") as NodeList
            if (m.length > 0) root.removeChild(m.item(0))

            val bg = editor.file.getElementsByTagName("background").item(0) as Element
            val fg = editor.file.getElementsByTagName("foreground").item(0) as Element
            bg.removeAttribute(attrToRemove)
            fg.removeAttribute(attrToRemove)

            val importedBg = editor.file.importNode(bgElement, true)
            val importedFg = editor.file.importNode(if (i == 0) fgElement else roundFgElement, true)
            bg.appendChild(importedBg)
            fg.appendChild(importedFg)
        }

        // in-app
        val targetTint = "@color/twitter_blue"
        for (path in listOf("res/layout/ocf_twitter_logo.xml", "res/layout/channels_toolbar_main.xml")) {
            context.xmlEditor[path].use { editor ->
                val e = editor.file.getElementsByTagName("ImageView").item(0) as Element
                e.setAttribute("app:tint", targetTint)
            }
        }

        context.xmlEditor["res/drawable/ic_vector_twitter.xml"].use { editor ->
            val e = editor.file.getElementsByTagName("path").item(0) as Element
            e.setAttribute("android:pathData", inapp_icon_vec_path)
        }
        // splash
        context.xmlEditor["res/drawable/splash_screen_icon.xml"].use { editor ->
            val e = editor.file.getElementsByTagName("vector").item(0) as Element
            e.setAttribute("android:viewportWidth", "288.0")
            e.setAttribute("android:viewportHeight", "288.0")
            val p = editor.file.getElementsByTagName("path").item(0) as Element
            p.setAttribute("android:pathData", splash_icon_vec_path)
            p.removeAttribute("android:fillType")
        }
    }
